import React, { useEffect, useState } from "react";
import { FiUsers, FiLogOut } from "react-icons/fi";
import { FaChartBar } from "react-icons/fa";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import { BrowserRouter as Router } from "react-router-dom";

const Dashboard = () => {
  const [user, setUser] = useState(null);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();

  useEffect(() => {
    axios
      .get("http://localhost:3001/profile", { withCredentials: true })
      .then((response) => {
        setUser(response.data.user);
        setLoading(false);
      })
      .catch(() => {
        navigate("/login");
      });
  }, [navigate]);

  const handleLogout = async () => {
    try {
      await axios.post("http://localhost:3001/logout", {}, { withCredentials: true });
      navigate("/login");
    } catch (error) {
      console.error("Logout failed", error);
    }
  };

  if (loading) {
    return <div>Loading...</div>;
  }

  return (
    <Router>
      <div className="p-6 bg-gray-100 min-h-screen">
        <div className="bg-white p-6 rounded-lg shadow-lg max-w-4xl mx-auto">
          <div className="flex justify-between items-center mb-6">
            <h1 className="text-2xl font-bold">Welcome, {user?.name}</h1>
            <button onClick={handleLogout} className="text-red-500 flex items-center">
              <FiLogOut className="mr-2" /> Logout
            </button>
          </div>
          <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
            <div className="p-4 bg-blue-500 text-white rounded-lg shadow-lg flex items-center">
              <FiUsers className="text-3xl mr-4" />
              <div>
                <h2 className="text-xl font-semibold">Users</h2>
                <p>1,234 Active</p>
              </div>
            </div>
            <div className="p-4 bg-green-500 text-white rounded-lg shadow-lg flex items-center">
              <FaChartBar className="text-3xl mr-4" />
              <div>
                <h2 className="text-xl font-semibold">Performance</h2>
                <p>87% Efficiency</p>
              </div>
            </div>
          </div>
        </div>
      </div>
    </Router>
  );
};

export default Dashboard;
